import './App.css';
import data from './input.json';

function App() {
  const elementRender = (type, title, children) => {
    if (type === 'block') {
      return (
        <div> title
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </div>
      )
    }
    else {
       return (
        <div> title
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </div>
      )
    } 
  }
  const renderJson = element => {
    return (
      elementRender(element.type, element.title, element.children)
    )
  }
  return (
      <div>
        {data.map((element) => (
          renderJson(element)
        ))}
      </div>
  );
}

export default App;
